import React, { Component } from 'react';
import PropTypes from 'prop-types';
import contactimage from '../img/contact.png'
import { Form, Button, } from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faPaperPlane } from '@fortawesome/free-solid-svg-icons'
class contact extends Component {
    constructor(props) {
        super(props);

    }


    render() {
        return (
            <div>
                <section className="contactsection" id="cntc">
                    <div className="container">
                        <div className="serviceheader">
                            <h1 className="text-center" id="servicehead"> Contact Me</h1>
                            <div className="underlinecontact"></div>
                        </div>
                        <div className="row">
                            <div className="col-md-6">
                                <img src={contactimage} className="contactmesideimage" alt="contactmesideimage" data-aos="fade-left" />
                            </div>


                            <div className="col-md-6">
                                <Form className="mt-4">

                                    <Form.Group controlId="formBasicName">
                                        <Form.Label>Full Name</Form.Label>
                                        {/* <Form.Control type="name" placeholder="Enter your name" /> */}
                                        <input type="text" onChnage={(event)=>{this.setState({name:event.target.value})}}></input>
                                    </Form.Group>

                                    <Form.Group controlId="formBasicEmail">
                                        <Form.Label>Email</Form.Label>
                                        <Form.Control type="email" placeholder="Enter your email" />
                                    </Form.Group>

                                    <Form.Group controlId="exampleForm.ControlTextarea1">
                                        <Form.Label>Message</Form.Label>
                                        <Form.Control as="textarea" rows={3} />
                                    </Form.Group>

                                    <Button variant="primary" type="submit"><FontAwesomeIcon id="paperplane" className="mr-2" icon={faPaperPlane}></FontAwesomeIcon>Send</Button>
                                </Form>
                            </div>
                        </div>
                    </div>
                </section>
            </div>
        );
    }
}

contact.propTypes = {

};

export default contact;
